import './App.css';
import ContactList from './components/container/contactList';


function App() {
  return (
    <div className="lista-contactos text-center">
      <h1>Lista de Contactos</h1>
      <div className='Lista'>
          <ContactList/>
      </div>
    </div>
  );
}

export default App;
